        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Navodi relativnu snagu lokalnih prinudnih radnji u odnosu na globalne prinudne radnje pri raspoređivanju čvorova i veza. Raspored čvorova i veza se određuje na osnovu algoritma usmerenih sila. Algoritam pronalazi položaje čvorova koji nisu preblizu jedni drugima i veze koje su približno iste dužine.</p><p class\\="xis-paragraph">U principu, veća vrednost za <span class\\="xis-windowItem">Jačina sile</span> unosi veće rastojanje između čvorova u mreži.</p></section>',
