        "vaeua-gui-eua.sas.van.control.initialValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Označava početnu (podrazumevanu) vrednost za kontrolu. Početna vrednost se bira kada korisnik prvi put otvori izveštaj ili kada korisnik izabere <span class\\="xis-windowItem">Vrati podrazumevano stanje izveštaja</span>. </p><div class\\="xis-paragraph">Unesite vrednost u tekstualno polje ili navedite nešto od sledećeg\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatski</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">označava da se vaš izbor čuva kao početna vrednost kada sačuvate izveštaj. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Prvo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> označava da je prva vrednost u kontroli početna vrednost.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">ime parametra</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">označava da je vrednost parametra koji izaberete početna vrednost za kontrolu.</p><p class\\="xis-paraSimple">Možete da izaberete parametar samo ako već postoji parametar sa odgovarajućim tipom podataka.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Ako početna vrednost nije u upitu podataka (na primer, zbog filtera) i kontrola nije obavezna, onda kontrola nema početnu vrednost. Ako je kontrola obavezna, onda se prva vrednost bira kao početna vrednost.</p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.aria.txt": "Pomoć. Više informacija o ovoj opciji ",
