        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Opcija <span class\\="xis-windowItem">Upravljanje preklapanjem</span> određuje radnju koja se preduzima za prikazivanje oznaka trake kada nema dovoljno prostora za njihov prikaz, usled čega se preklapaju.</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Automatski</span></td><td>automatski prilagođava oznake.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Ništa</span></td><td>ne obavlja upravljanje preklapanjem.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Smanjite broj prilagođenih kategorija da biste eliminisali sledeći problem. Na primer, da biste eliminisali probleme niskog prioriteta, smanjite broj kategorija u izveštaju na 25 ili manje.</p><p class\\="xis-paragraph">Niski prioritet\\: sadrži &gt; 25 prilagođenih kategorija</p></section>',
