        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Opcija <span class\\="xis-windowItem">Upravljanje preklapanjem vrednosti kategorija</span> određuje metod koji se koristi za uklapanje vrednosti podeljaka na osi kada nema dovoljno prostora za njihov prikaz, usled čega se preklapaju. Sa izuzetkom opcije <span class\\="xis-windowItem">Uvek rotiraj</span>, navedeni metod se primenjuje samo po potrebi. U suprotnom, vrednosti podeljaka se prikazuju bez izmene. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Odstupi, skrati, otpusti sve</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">pomera vrednosti nagore i nadole, odseca znakove od vrednosti, a zatim otpušta sve vrednosti.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Prikaži sve</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">prikazuje sve vrednosti, čak i ako se neke od njih preklapaju.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotiraj</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">dijagonalno rotira sve vrednosti.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Uvek rotiraj</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">dijagonalno rotira sve vrednosti, bez obzira na to da li se preklapaju.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Uvek rotiraj, otpusti sve</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">dijagonalno rotira sve vrednosti, a zatim ih sve otpušta.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Odstupi</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">pomera vrednosti nagore i nadole.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Odstupi, skrati</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">pomera vrednosti nagore i nadole, a zatim odseca znakove od vrednosti.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Skrati</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">odseca znakove od vrednosti.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Skrati, rotiraj</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">odseca znakove od vrednosti, a zatim dijagonalno rotira sve vrednosti.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "Više informacija o ovoj opciji ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Obavlja izbor promenljive sa brzim premotavanjem unazad da bi se utvrdilo koje promenljive se uzimaju u obzir prilikom kreiranja modela. Uzimaju se u obzir samo promenljive sa <span class\\="xis-userSuppliedValue">p</span>-vrednostima ispod navedenog nivoa značaja.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Vašem izveštaju je potrebno mnogo vremena da učita prvu stranicu. Ako SAS Visual Analytics identifikuje probleme sa performansama koji nisu spora vremena učitavanja, rešite prvo njih. Ako nisu identifikovani drugi problemi sa performansama, obratite se administratoru da biste utvrdili da li drugi faktori utiču na vaš izveštaj. Na primer, spora veza može da dovede do toga da se izveštaj učitava sporo.</p><p class\\="xis-paragraph">Niski prioritet\\: traje &gt;\\= 5 sekunde</p><p class\\="xis-paragraph">Srednji prioritet\\: traje &gt;\\= 10 sekundi</p><p class\\="xis-paragraph">Visoki prioritet\\: traje &gt;\\= 25 sekundi</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "Pomoć. Više informacija o ovoj opciji ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Navodi funkciju aktivacije koja se koristi za kreiranje izlaznog sloja kada se koristi normalna raspodela za modelovanje odziva. Eksponencijalna funkcija aktivacije se koristi sa gama ili Poisson raspodelom. </p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Uključite povezane stavke podataka (dodele uloga, pravila za prikaz itd.) u sačuvani objekat.</p></section>',
