        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Navodi alfa vrednost za meru složenosti troška koja se koristi za glačanje stabla regresije. Veća alfa vrednost kreira manje stablo.</p></section>',
