        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Određuje da li se koristi lista reči koje treba izostaviti. Lista reči koje treba izostaviti je jednostavna kolekcija reči sa malo informacija ili stranih reči koje želite da uklonite iz teksta. Ove reči moraju da se sačuvaju u SAS skupu podataka koji je učitan na CAS server.</p></section>',
