        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Koristi podrazumevani broj predskazivača koji će se probati po deljenju. Podrazumevana vrednost je ukupan broj predskazivača. U suprotnom, navedite broj predskazivača koji će se probati po deljenju.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Koristi podrazumevanu kaznenu vrednost. Podrazumevana vrednost je 1.0.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageCount.help.aria.txt": "Pomoć. Više informacija o ovoj opciji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ako je broj opservacija kojima nedostaju vrednosti za predskazivač kandidata veći od ili jednak minimalnoj navedenoj vrednosti, onda se vrednosti koje nedostaju tretiraju kao posebna vrednost prilikom pretraživanja kandidata podele.</p></section>',
        "vaeua-gui-eua.barSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Opcija <span class\\="xis-windowItem">Razmak</span> određuje razmak između traka.</p><p class\\="xis-paragraph">Za grupisane klasterske trake, razmak se pojavljuje između klastera. Nema razmaka između pojedinačnih traka u okviru klastera.</p></section>',
