        "vaeua-gui-eua.sas.van.ReportReview.HighCustomSortEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Smanjite broj vrednosti u prilagođenim sortiranjima da biste eliminisali sledeći problem. Na primer, da biste eliminisali probleme niskog prioriteta, smanjite broj izabranih vrednosti u prilagođenom sortiranju na 25 ili manje.</p><p class\\="xis-paragraph">Niski prioritet\\: sadrži &gt; 25 sortiranja</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionCriterion.help.tip.txt": "Više informacija o ovoj opciji ",
        "vaeua-gui-eua.Properties.logisticRegression.fConvValue.help.tip.txt": "Više informacija o ovoj opciji ",
