        "vaeua-gui-eua.Properties.predAuto.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Proširuje analizu kako bi se obuhvatile opservacije sa vrednostima koje nedostaju. Za faktore kategorija, vrednosti koje nedostaju se tretiraju na njihovom sopstvenom nivou kada se obavlja analiza. Za faktore mera, vrednosti koje nedostaju se koriste u izračunavanju vrednosti pravila podele. Proizvodi se pravilo podele koje dodeljuje vrednosti koje nedostaju grani koja uvećava vrednost podele.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.auto_stop_method.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Označava kriterijum za iskorišćavanje podataka provere valjanosti u svrhe prekida učenja pri lokalno optimalnom ponavljanju.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.learningRate.help.tip.txt": "Više informacija o ovoj opciji ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Navodi metod za tretiranje vrednosti koje nedostaju za predskazivače. Za odziv kategorije, ovim se tretiraju i vrednosti koje nedostaju kao važeći nivo odziva.</p></section>',
