        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Opcija <span class\\="xis-windowItem">Upravljanje preklapanjem vrednosti mera</span> određuje metod koji se koristi za uklapanje vrednosti podeljaka na osi kada nema dovoljno prostora za njihov prikaz, usled čega se preklapaju.                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Otpusti neke</span></td><td>otpušta neke vrednosti.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Prikaži sve</span></td><td>prikazuje sve vrednosti, čak i ako se neke od njih preklapaju.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rotiraj</span></td><td>dijagonalno rotira sve vrednosti.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Uvek rotiraj</span></td><td>dijagonalno rotira sve vrednosti, bez obzira na to da li se preklapaju.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Uvek rotiraj, otpusti sve</span></td><td>dijagonalno rotira sve vrednosti, a zatim ih sve otpušta po potrebi.</td></tr></table></div>                 </div></section>',
