        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Proširuje model kako bi se obuhvatile opservacije sa vrednostima koje nedostaju. Neprekidni efekat je pripisan sa zabeleženom srednjom vrednošću i promenljivom indikatora koja označava da je kreiran nedostatak podataka. Efekat klasifikacije tretira vrednosti koje nedostaju kao poseban nivo. </p></section>',
