        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Prikazuje najčešće ili najređe preporučene kategorije za svaku promenljivu kategorije. Da biste mogli da izaberete predskazivač, morate da dodelite bar jedan.</p></section>',
