        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Označava broj klastera za kreiranje ili označava da treba koristiti metod kriterijuma poravnatog okvira (aligned box criterion – ABC) za izvođenje optimalnog broja klastera.</p><p class\\="xis-paragraph">ABC metod prvo bira određeni broj klastera za kreiranje, kreira klastere i izračunava statistiku razmaka za svaki klaster. Potom se kreira raspodela referenci koja je orijentisana oko svakog klastera i izračunava se statistika razmaka za svaku raspodelu referenci. Ovaj proces se ponavlja za svaki potencijalni broj klastera. Broj klastera koji uvećava ukupnu razliku između statistike razmaka klastera i referentnih podataka bira se kao optimalan broj klastera.</p><p class\\="xis-paragraph">ABC metod važi samo kada su svi ulazi promenljive mere.</p></section>',
