        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Koristi podrazumevani broj predskazivača koji će se probati po deljenju. Podrazumevana vrednost je kvadratni koren ukupnog broja predskazivača. U suprotnom, navedite broj predskazivača koji će se probati po deljenju.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Navodi broj sekcija koje se koriste za kategorizaciju promenljivih mera u dijagramu delimične zavisnosti.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Omogućava algoritam brzog kreiranja klastera k-srednje vrednosti i zanemaruje raspored sekcije. Nemojte izabrati ovu opciju ako želite da koristite sveobuhvatan algoritam pretrage i da poštujete redosled sekcije. Nepodeljeni odzivi mere koriste odstupanje kao kriterijum za izbor. Kada se izabere ova opcija, odzivi kategorija i podeljeni odzivi mere koriste kriterijum odnosa prirasta. U suprotnom, koristi se apsolutni prirast.</p></section>',
