        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Pokušava da kreira naivnu Bajesovu mrežu i proširenu naivnu Bajesovu mrežu. Naivna Bajesova mreža navodi da je promenljiva odziva jedini nadređeni element za sve predskazivače. To podrazumeva uslovnu nezavisnost svih predskazivača, s obzirom na promenljivu odziva. Proširena naivna Bajesova mreža proširuje naivnu mrežu tako što dozvoljava čvorovima predskazivača da kreiraju Bajesovu mrežu.</p></section>',
