        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Označava nivo prilagođavanja koji svaki korisnik može da primeni na prikaz izveštaja. Svaki nivo uključuje nivoe ispod njega.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Generiše prilagođene HTML oznake kako bi objekat ili izveštaj mogli da se ugrade na veb stranicu.</p><p class\\="xis-paragraph">Da biste omogućili prilagođene oznake na veb stranici, morate da dodate i &lt;script&gt; oznake u zaglavlje stranice. Za više informacija o ugrađivanju sadržaja programa SAS Visual Analytics pogledajte <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">dokumentaciju za SAS Visual Analytics SDK</a>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tip grupe <span class\\="xis-windowItem">Posebne vrednosti</span> dostupan je samo za mere sa nižim brojem jedinstvenih vrednosti.</p></section>',
