        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Izrađuje navedene strukture mreže koje se ponavljaju preko broja nadređenih elemenata od 1 do vrednosti maksimalnog broja nadređenih elemenata. Izabrana je mreža sa najboljom stopom pogrešne klasifikacije.</p></section>',
