        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Označava da korisnici preskaču ekran za prijavljivanje i automatski koriste akreditive gosta. Za korisnike sa akreditivima gosta, stanje prikaza se ne čuva između sesija i željene postavke korisnika nisu dostupne.</p></section>',
