        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Označava početnu maksimalnu vrednost (gornju granicu) za kontrolu. Početna vrednost se bira kada korisnik prvi put otvori izveštaj ili kada korisnik izabere <span class\\="xis-windowItem">Vrati podrazumevano stanje izveštaja</span>. </p><div class\\="xis-paragraph">Unesite vrednost u tekstualno polje ili navedite nešto od sledećeg\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatski</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">označava da se vaš izbor čuva kao početna vrednost kada sačuvate izveštaj. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Maksimalna vrednost</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">označava da je najveća vrednost u kontroli početna vrednost.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">ime parametra</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">označava da je vrednost parametra koji izaberete početna vrednost za kontrolu.</p><p class\\="xis-paraSimple">Možete da izaberete parametar samo ako već postoji parametar sa odgovarajućim tipom podataka.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Pomoć. Više informacija o ovoj opciji ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Navodi kako se saobraćaj koristi za izračunavanje vremena putovanja za grafičku funkciju. Izaberite jednu od sledećih opcija\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">ne</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Označava da izračunavanje vremena putovanja koristi utvrđeni prosek istorijskih podataka o saobraćaju za svako doba dana i za sve dane u nedelji.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Aktuelni saobraćaj</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Označava da izračunavanje vremena putovanja koristi trenutne uslove saobraćaja. Ovi podaci o saobraćaju se mogu ažurirati klikom na ikonu <span data-icon-name\\="refresh" alt\\="Ažuriraj podatke o saobraćaju" aria-label\\="Ažuriraj podatke o saobraćaju"></span>. Kada korisnik pogleda izveštaj, saobraćaj se ne ažurira automatski. Korisnik mora da ažurira podatke o saobraćaju kako bi odražavali najnovije uslove saobraćaja.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Tipičan saobraćaj</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> označava da proračun vremena putovanja koristi tipičan saobraćaj za određeno vreme i dan u nedelji. Tipični uslovi saobraćaja su zasnovani na nedavnim istorijskim podacima.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Napomena\\:</span> Vreme koje navedete je lokalno vreme za lokaciju na mapi.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Napomena\\:</span>Preuzimanje podataka o vremenu putovanja troši kredite Esri Premium usluga.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Napomena\\:</span>Ako podaci o saobraćaju nisu dostupni za oblast koja sadrži proračun vremena putovanja, objavljena ograničenja brzine se koriste za izračunavanje vremena putovanja.</div></section>',
