        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Opcija <span class\\="xis-windowItem">Rotacija stila elementa podataka</span> navodi kako se stilovi dodeljuju elementima podataka u predlošku grafikona. Na linijskom grafikonu, na primer, ova opcija navodi kako se boje, obrasci linija i oznake koriste za razlikovanje linija na grafikonu. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatski</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">koristi podešavanje rotacije stila iz teme. Većina SAS tema koristi podešavanje <span class\\="xis-windowItem">Rotiraj prvo sve boje</span>. Tema High Contrast koristi podešavanje <span class\\="xis-windowItem">Rotiraj sve atribute</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotiraj prvo sve boje</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">prikazuje neprozirnu popunu i stalan oblik oznake dok se ne iskoriste sve boje iz palete.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rotiraj sve atribute</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">prikazuje različite obrasce popunjavanja i oblike oznaka pored različitih boja. Ovo podešavanje može da poboljša pristupačnost za korisnike koji ne vide dobro boje (daltonisti).</p></dd></dl></div>                 </div></section>',
