        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Opcija <span class\\="xis-windowItem">Podešavanja grupisanja</span> određuje kako se podešavaju grupisani trakasti grafikoni. Trake mogu da budu naslagane ili grupisane. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Stvarne vrednosti</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">podešava veličinu traka na osnovu vrednosti podataka. Na primer, pretpostavimo da traka u jednoj grupi ima vrednost 50, a da traka u drugoj grupi ima vrednost 500. Traka koja ima vrednost 500 bi bila 10 puta viša od one čija je vrednost 50.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Normalizuj grupe na 100%</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">predstavlja grupe koje koriste relativno merilo. U okviru grupe, svaka traka se prikazuje kao procenat grupe. Na primer, pretpostavimo da grupa ima ukupnu vrednost 100. Ako neka traka u toj grupi ima vrednost 50, traka će činiti 50% visine grupe.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Ova opcija nije dostupna kada objekat grafikona sadrži prekrivene elemente grafikona. Ova opcija takođe nije dostupna kada navedete isti opseg podataka za ose u rešetki.</p></section>',
